import { useDispatch, useSelector } from 'react-redux';
import { searchById } from '../../redux/action';




const Detail = () => {
    const { id } = useParams();
    let dogById = useSelector(state => state.DogsById)
        if(!dogById.length) {        
            dogById = {
            name: dogById.name,
            image: dogById.image.url,
            weight: dogById.weight.metric,
            height: dogById.height.metric,
            id: dogById.id,
            temperament: dogById.temperament,
            life_span: dogById.life_span
        }
